}
mongoose.connect(uri, options).then(
  () => { console.log('Conectado a MongoDB') },
  err => { error }
);

app.use(morgan('tiny'));
app.use(cors());
app.use(express.json());
app.use(express.urlencoded({ extended: true }));

//Rutas de la app
/*app.get('/',  (req, res) => {
